import { Card, Container, Button, Col, Row } from "react-bootstrap";
import plot_img from "../statics/imgs/plt.jpg"
const Welcome = () => {
    return (
        <Container>
            <div >
                <h1 >Explore coderhub.sa in depth.</h1>
                <Card>
                    <img src="./statics/plot.jpg"></img>
                </Card>
            </div>
        </Container>
    );
}

export default Welcome;
